Game::AAttribute* GameAttributeUtil::getAttribute(int id)
{
	Game::AAttribute* ret = this->AttributesByID->at(id);
	return ret;
}

AttributeType GameAttributeUtil::getAttributeTypeByOpcode(AttributeOpcode opcode)
{
	int index = (int)opcode;
	AAttribute* aattribute = GameAttributeUtil::getSingletonPtr()->getAttribute(index);
	return aattribute->attributeType;
}